import React from "react";
import { Link } from "react-router-dom";

class Header extends React.Component {
	rende() {
		return (
			<nav>
				<Link to="/">Home</Link>
				<Link to="login">Login</Link>
				<Link to="main">Main</Link>
			</nav>
		)
	}
}
export default Header
